import React from "react";
import { Link } from "react-router-dom";
import Header from "../components/Header";

const NotFound = () => {
    return (
        <>
            <Header />
            <div className="container my-5">
                <div className="row justify-content-center align-items-center">
                    <h4 className="text-center mb-2 mb-sm-5">Página não encontrada</h4>
                    <img src="/images/not-found.png" alt="Not-found" style={{ width: "100%", height: "300px", objectFit: "contain" }}/>
                    <button className="col-md-3 col-sm-6 col-12 btn btn-success mt-5">
                        <Link to="/" className="text-white text-decoration-none">Home Page</Link>
                    </button>
                </div>
            </div>
        </>
    );
};

export default NotFound;
